import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home/Home";
import Q1 from "./pages/Q1/Q1"; // Assuming Q1 component is located in pages/Q1 directory
import Q2 from "./pages/Q2/Q2"; // Assuming you have a Q2 component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/q1" element={<Q1 />} />
        <Route path="/q2" element={<Q2 />} />
      </Routes>
    </Router>
  );
}

export default App;
